import './App.css';

import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


export default class App extends Component {

  render() {
    return (
      <div>
      <Router>
    <Navbar/>

    <Routes>
    <Route exact path="/general" element={<News pageSize={5} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="general" setCountry="in"/>} >

          </Route>


        </Routes>
    </Router>
      </div>
    )
  }
}
